*{box-sizing: border-box;margin:0;padding: 0;}
*::before{box-sizing: border-box;}
*::after{box-sizing: border-box;}

body{
    overflow: hidden;
}
.skin{
    position: relative;
}
.head{
    border: 5px solid #3c2724;
    width: 350px;
    height: 280px;
    position: absolute;
    left: 50%;
    top: 50px;
    margin-left: -175px;
    border-radius: 43%;
    background: black;
}

.eye{
    border: 5px solid #3c2724;
    width: 170px;
    height: 214px;
    position: absolute;
    left: 50%;
    top: 75px;
    margin-left: -85px;
    border-radius: 50%;
    background: white;
}
.eye.left{
    transform: translateX(-90px) rotate(5deg);
}
.eye.right{
    transform: translateX(90px) rotate(-5deg);
}
.eyeball{
    border: 5px solid #3c2724;
    width: 114px;
    height: 150px;
    position: absolute;
    left: 50%;
    top: 25px;
    margin-left: -57px;
    border-radius: 50%;
    background: black;
}
.eyeball.left{
    transform: translateX(-3px) ;
}
.eyeball.right{
    transform: translateX(3px) ;
}
.mouth{
    position: relative;
    left: 50%;
    top: 280px;
    width: 0;
    height: 0;
    margin-left:-17px;
    border: 20px solid transparent;
    border-top: 33px solid #3c2724;
}

.lip{
    position: absolute;
    left: 50%;
    top: -30px;
    width: 0;
    height: 0;
    margin-left:-14px;
    border: 14px solid transparent;
    border-top: 24px solid #6cb2d3;
}

.ear{
    border: 5px solid #3c2724;
    position: absolute;
    left: 50%;
    top: 35px;
    width:140px;
    height: 300px;
    margin-left: -70px;
    border-radius: 71px/150px;
    z-index: -1;
    background: black;
    overflow: hidden;
}
.ear.left{
    transform: translateX(-95px) rotate(160deg)
    /* transform: translateX(-95px) rotate(160deg) */
}
.ear.right{
    transform: translateX(95px) rotate(200deg)
    /* transform: translateX(95px) rotate(200deg) */
}
.earInner{
    position: absolute;
    left:50%;
    width:140px;
    height: 300px;
    border-radius: 71px/150px;
    margin-left: -70px;
    top: 50px;
    background: #97aa5b;
}
.earInner.left{
    transform: translateX(112px) rotate(30deg)
}
.earInner.right{
    transform: translateX(-112px) rotate(330deg)
}
.hand{
    border: 5px solid #3c2724;
    position: absolute;
    left: 50%;
    top: 300px;
    width:60px;
    height: 40px;
    border-radius: 261px/161px;
    margin-left: -30px;
    background: black;
}
.hand.left{
    transform: translateX(-80px)
}
.hand.right{
    transform: translateX(80px)
}
